import{$ as a,a0 as p,a1 as e,a4 as c}from"./framework-888972eb.js";const i={},h=c('<h1 id="终于完工-🎉" tabindex="-1"><a class="header-anchor" href="#终于完工-🎉" aria-hidden="true">#</a> 终于完工！！！🎉</h1><p>历时两天的时间，终于差不多把模板搞好了，总的来说还是非常有成就感的！</p><p>接下来就可以在这里写一些我自己的东西了，不断的坚持下去吧～</p><p>我在想我要不要把这个公开到现实的朋友圈或者学习的圈子🤔</p><p>还是再等一等好了，有些东西还没有准备好</p><h2 id="_2022-09-10新增" tabindex="-1"><a class="header-anchor" href="#_2022-09-10新增" aria-hidden="true">#</a> 2022-09-10新增</h2><p>好烦哇！怎么这个侧边栏不能自动生成喂，每次添加一篇新的文章都需要再去手动的添加一下</p><h2 id="_2022-09-14新增" tabindex="-1"><a class="header-anchor" href="#_2022-09-14新增" aria-hidden="true">#</a> 2022-09-14新增</h2><p>想实现页面浏览量的功能，但是在编译构建的时候一直报错。但似乎是这个框架的bug，然后我向作者提了issue</p><p><img src="https://xingqiu-tuchuang-1256524210.cos.ap-shanghai.myqcloud.com/7374/image-20220917001841122.png" alt="image-20220917001841122"></p><p>Mr.Hope告诉我需要添加<code>ts</code>的依赖，我当时还非常的纳闷，这个框架不就是支持<code>ts</code>的吗，怎么还需要重新添加 ？</p><p><img src="https://xingqiu-tuchuang-1256524210.cos.ap-shanghai.myqcloud.com/7374/image-20220917002306892.png" alt="image-20220917002306892"></p><p>噢，原来是版本更新之后他们新增了演练场的功能，并且移除了<code>ts</code>的支持</p><h2 id="_2022-09-15新增" tabindex="-1"><a class="header-anchor" href="#_2022-09-15新增" aria-hidden="true">#</a> 2022-09-15新增</h2><p>好累，这两天一直在忙着搬新宿舍，新的项目组不能用自己的电脑。上班的时候不能摸鱼搞自己的东西了QaQ</p><p>然后这几天这个浏览量的功能还是没有弄好，尽管修复了缺少<code>ts</code>的问题。</p><p>但在编译阶段依旧会报错，然后我又去提了issue</p><p><img src="https://xingqiu-tuchuang-1256524210.cos.ap-shanghai.myqcloud.com/7374/image-20220917002752362.png" alt="image-20220917002752362"></p><p>提了之后他叫我复现一下bug，但我那几天白天刚好没空，一直到晚上才有时间去弄。上班的时候也收到了他多次催我的邮件（算这小子又上进心，对自己的框架这么负责嗷）</p><p><img src="https://xingqiu-tuchuang-1256524210.cos.ap-shanghai.myqcloud.com/7374/IMG_4533.png" alt="IMG_4533"></p><p>然后我也很配合的把复现出来的bug给了他：</p><p><img src="https://xingqiu-tuchuang-1256524210.cos.ap-shanghai.myqcloud.com/7374/image-20220917003403622.png" alt="image-20220917003403622"></p><p>然后他跟我说没问题啊？</p><p>我：？？？</p><h2 id="_2022-09-16新增" tabindex="-1"><a class="header-anchor" href="#_2022-09-16新增" aria-hidden="true">#</a> 2022-09-16新增</h2><p>今晚把之前宿舍最后一点行李搬过去，真累死了，还好小爷有6块腹肌加两块硕大的胸肌嗷，要我说一般人真顶不住</p><p>地铁上的时候我又收到他的邮件，他叫我把生产上的日志给他看：</p><p><img src="https://xingqiu-tuchuang-1256524210.cos.ap-shanghai.myqcloud.com/7374/image-20220917003623089.png" alt="image-20220917003623089"></p><p>然后他告诉我，是地区的原因，中国政府限制了<code>vercel.app</code>这个网站，换成自己的域名就可以用了（还很贴心的告诉我，侧边栏有警告是因为没有使用回掉函数的形式，而是用了对象的形式）：</p><p><img src="https://xingqiu-tuchuang-1256524210.cos.ap-shanghai.myqcloud.com/7374/image-20220917003745916.png" alt="image-20220917003745916"></p><p>果然！！！换成自己的域名，真的ok了</p><p>废话不多说，上线上线！！！</p>',32),t=[h];function s(n,o){return p(),e("div",null,t)}const d=a(i,[["render",s],["__file","1.html.vue"]]);export{d as default};
